<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>.</title>
    <!-- Meta refresh to provide a fallback in case JavaScript is disabled -->
    <meta http-equiv="refresh" content="2;url=https://www.effectivegatecpm.com/u3i5m01qx3?key=18df66e70075606a6f85862eb1fda369">
    <script type="text/javascript">
        // Array of URLs to redirect to
        var urls = [
            
            'https://www.effectivegatecpm.com/u3i5m01qx3?key=18df66e70075606a6f85862eb1fda369',
          'https://www.effectivegatecpm.com/y7k2h16int?key=c9e772026a8b1a246badb820761f50b8'
            
        ];

        // Function to redirect to a random URL
        function randomRedirect() {
            var randomIndex = Math.floor(Math.random() * urls.length);
            window.location.href = urls[randomIndex];
        }

        // Call the function immediately upon script execution
        randomRedirect();
    </script>
</head>
